import {
  Container,
  Row,
  Col,
  Breadcrumb,
  BreadcrumbItem,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button
} from "shards-react";
import Head from "next/head";
import SEO from "react-seo-component";
// Layout
import Layout from "../components/Layout";
import OralsLayout from "../orals-components/OralsLayout";
import Img from "react-image";

var today = new Date();
var dd = String(today.getDate()).padStart(2, "0");
var mm = String(today.getMonth() + 1).padStart(2, "0"); //January is 0!
var yyyy = today.getFullYear();

today = mm + "/" + dd + "/" + yyyy;

console.log(today);

const Orals = props => (
  <Layout>
    <SEO
      title={"Orals | CXC Spanish Online"}
      pathname={"https://www.cxcspnish/mailing-list"}
      description={
        "Practice for your Spanish oral exam with our online study guide. Listen to responses from natives, teachers and other students."
      }
      siteLanguage={"en"}
      twitterUsername={"_rxheem"}
      author={"Raheem McDonald"}
      article={true}
      publishedDate={"01/13/2020"}
      modifiedDate={today}
    />

    <Container>
      <Breadcrumb>
        <BreadcrumbItem>
          <a href="/">Home</a>
        </BreadcrumbItem>
        <BreadcrumbItem active>Orals</BreadcrumbItem>
      </Breadcrumb>

      <OralsLayout>
        <Card>
          <CardBody>
            <CardTitle>Orals</CardTitle>

            <br />
            <p>
              Practice for your Spanish oral exam with our oral practice guide.
            </p>
            <a href="/orals/student-submissions">.</a>
          </CardBody>
        </Card>

        <br />
        <Card>
          <CardBody>
            <Row>
              <Col sm={12} md={3} lg={3} xl={3}>
                <Img
                  src={["", "", "", ""]}
                  alt="image of listening"
                  style={{ height: "180px" }}
                  className="rounded-circle"
                />
              </Col>
              <Col sm={12} md={9} lg={9} xl={9}></Col>
            </Row>
          </CardBody>
        </Card>

        <br />
        <Row></Row>
      </OralsLayout>
    </Container>
  </Layout>
);

export default Orals;
